function fullundividedpage() {
  return (
    <div style={{
      border: "1px solid #ccc",
      borderRadius: "10px",
      padding: "1rem",
      margin: "1rem",
      width: "250px",
      boxShadow: "2px 2px 10px rgba(0,0,0,0.1)"
    }}>
      <h1>Veronica's Portfolio</h1>
      <p>fullundividedpage...</p>
    </div>
  );
}

export default fullundividedpage;
